import { Button } from 'react-bootstrap';
import initialCards from '../util/initialCards'
// This is the starting structure of your cards



const Sidebar = ({ onAddCard }) => {
  return (
    <div className="sidebar">
      {initialCards.map((card) => (
        <Button key={card.id} variant="secondary" className="mb-2" onClick={() => onAddCard(card)}>
          {card.title}
        </Button>
      ))}
    </div>
  );
};
